import React, { useState } from 'react';
import { Route, Routes } from 'react-router-dom';
import Main from './pages/Main/Main';
import SignUp from './pages/SignUp/SignUp';
import Navbar from './components/Navbar/Navbar';
import SingleCar from './pages/SingleCar/SingleCar';
import FormCar from './pages/FormCar/FormCar';
import { Context } from './context/context';
import { ICars, IUser } from './types/types';

function App() {
  const [contextState, setContextState] = useState<ICars[]>(() => JSON.parse(localStorage.getItem('cars') || '[]'));

  const changeValue = (val) => {
    setContextState(val)
  }
  return (
    <div className="App">
    <Context.Provider value={changeValue, contextState}>
    <Navbar />
      <Routes>
       <Route path="/" element={<Main />} initialParams={contextState, changeValue}/>
       <Route path="/signup" element={<SignUp />} />
       <Route path="/:Model_ID" element={<SingleCar />} />
       <Route path="/form" element={<FormCar />} />
      </Routes>
      <footer />
      </Context.Provider>
    </div>
  );
}

export default App;
